import { Form } from 'react-bootstrap';

function DataField() {
    return (
        <Form.Group>
            <Form.Label>
                Data:
            </Form.Label>
            <Form.Control
                as="textarea"
                type="text"
                placeholder=""
                ref={(input) =>
                    console.log(input)
                }
                value = 'DATA FIELD TEXT'
            />
        </Form.Group>
    );
}

export default DataField;
